\usepackage{amsmath}
\usepackage{tikz}

\begin{document}

Two octaves of $\mathcal{T}_5(100)$ together with $\Delta_5$ defined in Example \ref{EX.5-EDO with 100}.

\begin{center}
    \begin{tikzpicture}[scale=0.8]
        % Draw the horizontal axis
        \draw[->] (-2,0) -- (10,0) node[right] {Hz};

        % Mark the frequency points
