            -1/$100$, 
            1/$120$, 
            3/$140$, 
            5/$160$, 
            7/$180$, 
            9/$200$, 
            11/$240$, 
            13/$280$, 
            15/$320$, 
            17/$360$, 
            19/$400$
        } {
            \draw (\x,0.1) -- (\x,-0.1) node[below] {$\nu_{k,\label}$};
