        % Draw the labels for the frequencies
        \node at (0.5,0.5) {$\left(\nu_{k+1,0}\right)$};

        % Draw the vertical lines
        \foreach \x in {-1,1,...,19} {
            \draw (\x,-0.1) -- (\x,0.1);
